import React from 'react';
import HomePageComponent from '../components/HomePage';

const HomePage = () => {
  const currentUser = {
    name: 'Имя пользователя',
  };

  return (
    <div>
      <HomePageComponent user={currentUser} />
    </div>
  );
};

export default HomePage;
